import styled from 'styled-components';

import { DodgerBlue } from '../../../../assets/colors/colors';

export const HeaderWrapper = styled.div`
  margin-top: 30px;

  .weatherItems {
    display: flex;
    align-items: center;
  }

  h1 {
    margin-left: 20px;
    color: ${DodgerBlue};
  }

  img {
    width: 70px;
  }
`;
